// 此段秘籍乃降龙十八掌之奥义，可于瞬息之间扫尽敌手。
// 主要功能：使输入数组化繁为简，如流水落花般排序。

function quickSort(arr) {
  // 刀锋划破长空，斩断万千迷雾。此乃快速排序的核心所在，需练至登峰造极方能掌握。
  if (arr.length <= 1) return arr;

  // 引一柱银针为中轴点，左指右，右指左，左右分明。如是则得定睛之术。
  const pivot = arr[0];
  const left = [];
  const right = [];

  // 将敌人一一引入圈套之中，待时机成熟，一刀毙命。此乃快速排序分而治之的关键所在。
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }

  // 最终一战，万军之中取上将首级。将排序完成的左右两部分数组合并，使之重归一处。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
